import React from 'react';
import "../Asserts/Css/Pages/Touristvisa.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';


const TouristVISA = ()=>{
    return (
          <div className='Touristvisapage'>
              <Header></Header>
              <Navbar></Navbar>
              <StudyAbroad></StudyAbroad>
             <h1>Tourist VISA</h1>
             <p>Visitor Visa – is for applicants who intend to travel to Canada, Australia, Europe, UK, New Zealand or anywhere across the world as tourists. The visitor visa or Temporary Resident Permit (TRV) is country specific and may be for single entry, multiple entry or transit purposes. Generally, visitor visas may be granted for a renewable period of 6 months.</p>

             <h1>PRE AND POST LANDING SERVICES</h1>
             <ul>
                 <li>Evaluation and Assessment
</li>
                 <li>Preparation of Client’s File
</li>
                 <li>Interview Preparation (where required)
</li>
                 <li>Providing orientation session regarding that particular country and its life-style
</li>
                 <li>Personal Guidance for updating your profile.
</li>
                 <li>Formalities at Port of Entry.
</li>
                 <li></li>
                 <li></li>
                 <li></li>
             </ul>

<YourNextStep></YourNextStep>
           <Footer></Footer>
              </div>
    )
}

export default TouristVISA  ;
